import "./nav.scss";
import { Link, Outlet } from "react-router-dom";
import { Fragment } from "react";

function Nav() {
	return (
		<Fragment>
			<div className="nav">
				<Link to="/">
					<div>Logo</div>
				</Link>
				<div className="nav-links-container">
					<Link className="nav-link" to="/shop">
						Shop
					</Link>
				</div>
			</div>
			<Outlet />
		</Fragment>
	);
}

export default Nav;
